CREATE TABLE m_training_tree_card_story_side(
  card_m_id INTEGER NOT NULL,
  training_content_type INTEGER NOT NULL,
  training_content_no INTEGER NOT NULL,
  story_side_m_id INTEGER NOT NULL,
  PRIMARY KEY (card_m_id, training_content_type, training_content_no),
  FOREIGN KEY (card_m_id) REFERENCES m_card(id),
  FOREIGN KEY (story_side_m_id) REFERENCES m_story_side(id)
);
